  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes my identifications
  of spiders for graduate student Matthew Vander Haegen, College of Forest Resources,
  Department of Wildlife, University of Maine, Orono. During the summer of 1987, spiders
  were fieldcollected on the Moosehorn National Wildlife Refuge, MNWR Calais, Washington
  County, Maine, by M. Vander Haegen and A. Narahara as part of an investigation entitled,
  Bioenergetic Aspects of Habitat Use by Woodcock during the Breeding Season.  The
  collections came from two principal sources: 1 vegetation plot data, and 2 miscellaneous
  habitats. Two additional collections were made off of the MNWR and are summarized
  in the Appendix.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
